  	render() {

  		return (
        <>

            <div className = "resultField"> {this.props.finalResult} </div>


            <div className="freqBorder">
              <div className="bar"></div>
            </div>

            <IconButton style={{color: "#002984"}} onClick={() => window.location.reload(false)}>
              <FunctionsIcon />
            </IconButton>
        </>
        )
  	 }


}

export default Result;
